import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import hellow_world from './App'


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
    <hellow_world/> 
  </React.StrictMode>
);
